import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import grail.AtomicShapes.ALine;
import grail.AtomicShapes.Line;
import util.misc.ThreadSupport;

public class Assignment1 {
	
	final static long wait = 3000;

	public static void main(String[] args) {
		animateLine();
	}
	
	public static void animateLine() {
		Line newLine = new ALine();
		OEFrame editor = ObjectEditor.edit(newLine);
		editor.showDrawPanel();
		editor.showTreePanel();
		
		ThreadSupport.sleep(wait);
		newLine.setX(100);
		newLine.setY(150);
		editor.refresh();
		ThreadSupport.sleep(wait);
		newLine.rotate(-5);
		editor.refresh();
	}

}

