		setX(INIT_X);
		setY(INIT_Y);
		setRadius(INIT_Radius);
		setAngle(45);
		rotate(INIT_Rotate);
	}

	public ALine(double NewRadius, double NewAngle) {
		setRadius(NewRadius);
		setAngle(NewAngle);
	}

	public int getX() {
		return X;
	}

