package graphics;

import tags301.Comp301Tags;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Tags;

@Tags(Comp301Tags.ROTATING_LINE)
@StructurePattern(StructurePatternNames.LINE_PATTERN)
@PropertyNames({
	"X",
	"Y",
	"Width",
	"Height",
	"Radius",
	"Angle"
	})
@EditablePropertyNames({
	"Radius",
	"Angle",
	"X",
	"Y",
	"Height"
})

public class ALine extends ALocatable implements Line {
	int X, Y, Width, Height;
	double Radius, Angle;

	public ALine() {
		setRadius(40);
		setAngle(45);
		rotate(6);
		setX(50);
		setY(50);
	}
	
	public ALine(int INIT_X, int INIT_Y, double INIT_Radius, int INIT_Rotate) {
		setX(INIT_X);
		setY(INIT_Y);
		setRadius(INIT_Radius);
		setAngle(45);
		rotate(INIT_Rotate);
	}

	public ALine(double NewRadius, double NewAngle) {
		setRadius(NewRadius);
		setAngle(NewAngle);
	}

	public int getX() {
		return X;
	}

	public void setX(int NewX) {
		X = NewX;
	}

	public int getY() {
		return Y;
	}

	public void setY(int NewY) {
		Y = NewY;
	}

	public int getWidth() {
		return Width;
	}

	public int getHeight() {
		return Height;
	}
	
	public void setHeight(int NewHeight) {
		Height = NewHeight;
	}

	public double getRadius() {
		return Radius;
	}

	public void setRadius(double NewRadius) {
		Radius = NewRadius;
	}

	public double getAngle() {
		return Angle;	
	}

	public void setAngle(double NewAngle) {
		Angle = NewAngle;
		Height = (int) (getRadius()*Math.sin(Angle));
		Width = (int) (getRadius()*Math.cos(Angle));
	}

	public void rotate(int units) {
		double Rotate = units * Math.PI/32;
		setAngle(Rotate + Angle);
	}

	@Override
	public void move(int NewX, int NewY) {
		setX(getX()+NewX);
		setY(getY()+NewY);
	}

	}

