		Torso.setX(INIT_X);
		Torso.setY(INIT_X);
		Neck = new ALine();
		Neck.setHeight(10);
		Neck.setRadius(INIT_Radius);
		Neck.setX(INIT_X);
		Neck.setY(INIT_Y-INIT_Neck);
		head = new AHead();
		text = new AStringShape();
		head.setImageFileName(headImage);
		head.setX(150);
		head.setY(73);
